import React, { useState, useEffect } from 'react';
import axios from 'axios';


console.log(process.env.REACT_APP_YOUTUBE_API_KEY)

const App = () => {

  const [videos, setVideos] = useState([]);
  const [videoFilter, setVideoFilter] = useState('');

  const handleChange = (event) => {
    console.log(event.target.value)
    setVideoFilter(event.target.value)
  }

  useEffect(() => {
    axios
      .get('https://www.googleapis.com/youtube/v3/channels?key=AIzaSyAbnlDjtTzRH0MXRtdWapejsD5V0yzKLS0&channelId=UCu2YhywZvs7pXUEL3RCUEaA&part=snippet,id&order=date&maxResults=10')
      .then(response => {
        console.log('promise fulfilled')
        setVideos(response.data)
      })
  }, [])
  console.log('render', videos.length, 'videos')


  return (
    <div>
      <input value={videoFilter} onChange={handleChange} />

      <ul>
        {videos.map(video =>
          <li key={video.name}>
            {video.name}
          </li>
          )}
      </ul>

    </div>
  )
}

export default App;
